import React from "react";

const Shapes = () => {
  return (
    <>
      <div class="circle"></div>
      <div class="square"></div>
      <div class="rectangle"></div>
      <div class="triangle"></div>
      <div class="ellipse"></div>
      <div class="heart"></div>
      <div class="star"></div>
    </>
  );
};

export default Shapes;
